import { getRandom } from "./randomNumber/js";

const FOOD_TYPES = {
  common: {
    type: "common",
    cost: 1,
  },
};

export const createFood = () => {
  console.log(getRandom(256));
  return { x: 5, y: 5, ...FOOD_TYPES.common };
};
